import React from 'react'
import { Link } from 'react-router-dom';
const NavBar = () => {
  return (
    <div>
        <div className='border pb-4 bg-black text-white py-'>
        <div className='flex justify-between mx-6 sm:mx-28 mt-4 '>
            <h1 className='font-bold '>YOU TELL I DO</h1>
            <Link to="/"><h1 className='text-xs font-semibold mt-1'>LOGOUT</h1></Link>
        </div>
        </div>
        
    </div>
  )
}

export default NavBar
